import React from "react";
import Card from './Card'
import contacts from "../contacts"

function App(props) {
  contacts.forEach(function(contact){
  return (

      <div>
        <Card name = {contact.name} image = {contact.imgURL} tel = {contact.phone} email= {contact.email}  />
      </div>

  )
});
}

export default App;
